import './Header.css'
import { links } from '../../common/links';
export function Header({ text }) {
    const title = text[0] || '';

    text = Array.isArray(text) ? text.slice(1, 5) : [];

    const navItems = text.map((linkText) => {
        if (!linkText) return null;

        return (
            <div>
                {Object.entries(links).map(([linkText, url]) => (
                    <li key={linkText} className="nav-item">  {/* Добавляем key */}
                        <a href={url} className="nav-link">
                            {linkText}
                        </a>
                    </li>
                ))}
            </div>
        );
    });
    return (
        <header className='header'>
            <div className='d-flex content'>
                <div className='title'>{title}</div>
                <div className='d-flex link-block'>
                    <ul className="nav">
                        {navItems}
                    </ul>
                </div>
            </div>
        </header>
    )
}
